    [],nt"revision_timestamp": "2013-03-15T20:31:20.595045",nt"name": "socal-1971-1976-vectorized-shoreline-of-southern-california-derived-from-1971-1976-source-data",nt"isopen":
    false,nt"url": null,nt"notes": "There are critical needs for a nationwide
    compilation of reliable shoreline data. To meet these needs, the U.S. Geological
    Survey (USGS) has produced a comprehensive database of digital vector shorelines
    by compiling shoreline positions from pre-existing historical shoreline databases
    and by generating historical and modern shoreline data. Shorelines are compiled
    by state and generally correspond to one of four time periods: 1800s, 1920s-1930s,
    1970s, and 1998-2002. Each shoreline may represent a compilation of data from one
    or more sources for one or more dates provided by one or more agencies. Details
    regarding source are provided in the 'Data Quality Information' section of this
    metadata report. Shoreline vectors derived from historic sources (first three time
    periods) represent the high water line at the time of the survey, whereas modern
    shorelines (final time period) represent the mean high water line.",nt"license_title":
